  true,\n\t\"url\": null,\n\t\"notes\": \"The National Indian Education Study, 2007
  (NIES 2007), is a study that is part of the National Indian Education Study (NIES),
  which is a part of National Assessment of Educational Progress (NAEP) program; program
  data is available since 2005 at http://nces.ed.gov/nationsreportcard/nies/. NIES
  2007 (http://nces.ed.gov/nationsreportcard/nies/) is a cross-sectional survey that
  is designed to describe the condition of education for American Indian and Alaska
  Native (AI/AN) students in the United States. Students in public, private, Department
  of Defense, and Bureau of Indian Education-funded schools were sampled using paper-and-pencil
  assessment. Overall weighted response rate for 4th grade was 75 percent. Overall
  weighted response rate for 8th grade was 74 percent. Key statistics produced from
  NIES 2007 provides educators, policymakers, and the public with information about
  the academic performance in reading and mathematics of AI/AN fourth- and eighth-graders
  as well as their exposure to Native American culture.\",\n\t\"license_title\": \"Creative
